import React, { useState } from "react";
import { Stack, Heading } from "@chakra-ui/react";
import Header from "../components/Header";
import Conversation from "../components/Conversation";

const Chat = () => {
  return (
    <Stack spacing={10}>
      <Heading as='h1' size='xl'>Dating AI</Heading>
      <Header />
      <Conversation />
    </Stack>
  );
};

export default Chat;
